import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useForm } from 'react-hook-form';

const ReservationTable = () => {
  const [reservations, setReservations] = useState([]);
  const { register, handleSubmit, formState: { errors } } = useForm();

  useEffect(() => {
    axios.get('https://your-api-url/api/reservation/details')
      .then(response => {
        setReservations(response.data);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  const onSubmit = (data) => {
    console.log(data);
    // Handle form submission
  };

  return (
    <div>
      <h2>Reservation Details</h2>
      <form onSubmit={handleSubmit(onSubmit)}>
        <label>
          Customer ID:
          <input {...register('customerId', { required: true })} />
          {errors.customerId && <span>This field is required</span>}
        </label>
        <button type="submit">Submit</button>
      </form>
      <table>
        <thead>
          <tr>
            <th>Reservation ID</th>
            <th>Date</th>
            <th>Time</th>
            <th>No of Tables</th>
            <th>Customer Name</th>
            <th>Customer Email</th>
          </tr>
        </thead>
        <tbody>
          {reservations.map(reservation => (
            <tr key={reservation.reqId}>
              <td>{reservation.reqId}</td>
              <td>{reservation.date}</td>
              <td>{reservation.time}</td>
              <td>{reservation.noOfTables}</td>
              <td>{reservation.customerName}</td>
              <td>{reservation.customerEmail}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ReservationTable;
